window.bookSummaryJSON = "<p>Nominated, 2019 Audie Awards - Best Male Narrator&nbsp;&nbsp;</p> <p>Meet Threadbare. He is 12 inches tall, full of fluff, and really, really bad at being a hero.&nbsp;</p> <p>Magically animated and discarded by his maker as a failed experiment, he is saved by a little girl. But she's got problems of her own, and he might not be able to help her.</p> <p>Fortunately for the little golem, he's quick to find allies, learn skills, gain levels, and survive horrible predicaments. Which is good, because his creator has a whole lot of enemies …</p> <p>Warning: Contains profanity and violence.</p>"; 
